import React from 'react';

class SingleContainer extends React.Component{
	state = {
		array: [1, 2, 4, 5,6,7,8,9,10]
	}

	render(){
		return(
			<div>
				{this.state.array}
			</div>
		);
	}
}

export default SingleContainer;
